import ReactDOM from "react-dom";
import React, { useState } from "react";

import Jumbotron from "react-bootstrap/Jumbotron";
import Toast from "react-bootstrap/Toast";
import Container from "react-bootstrap/Container";
import Private from "./Private";
import Public from "./Public";
import Navbar from "./Navbar";

import { Button, Form, FormControl, Card, Carousel } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

export default class Welcome extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      index: 0,
      setIndex: 0,
      direction: null,
      setDirection: null
    };
  }

  async conponentDidMount() {}
  conponentDidUpdate() {}
  conponentWillUnmount() {}

  ExampleToast = ({ children }) => {
    const [show, toggleShow] = useState(true);
    return (
      <>
        {!show && <Button onClick={() => toggleShow(true)}>Show Toast</Button>}
        <Toast show={show} onClose={() => toggleShow(false)}>
          <Toast.Header>
            <strong className="mr-auto">React-Bootstrap</strong>
          </Toast.Header>
          <Toast.Body>{children}</Toast.Body>
        </Toast>
      </>
    );
  };

  render() {
    return (
      <Container className="p-3">
        <Navbar />
        <Container>
          <img
            src={
              "https://lh3.googleusercontent.com/KdJAAXUJhIe-wen6aUOwp9HEreVRYuRVasQhkvrOSO-20y6WDn0INi02l2KH06D9JSYzVdfImBxUq95IubfKqsABnv3MI6YR540nHV6V42WoC52m8MYRtbxn7NFHd08rUmpf5Ry0yne09orAC9VZnPWilcivH894r-OJrGgYJD2YdHvkPR6C2PtRjcI1oTRhzjQN4y7EbkkS1M579ECvEmltMpxfzWitVJUIRxM-22xr5pqZBqB7xhNLq_Bg7_pnjJJcL7h3qSNZ_Hb75mcTvGc-Ou7m3wqCfAekPk8zUI4XCjab7n97HK4Dc6CVPUCLX88ZI_Gs_7p_SLDD1zK8jpNbCreN-OMHi3eK1rH4qmw5RpbwrnI78yQFE3DFNivPN5PkOh9GVEXrStzVhgvx6LFgeeouGB3OxMHgSUliezOQpHwYRZB7B480QYZJ_AmYThABluwMMQrbPDFuudIJn8Q9k0W-zqjDAG-PX3Rddfer-LwwOmeSJI4yA3ltZfb5I02USLQfo59uHOwrUXLo_yxPb3DG3hkztSwlTTQEo7NHox4-mtjSetVD5F0kZT__Ev3LkNESTQ_OcGtCVT1Bv7hSZ18Jlcf6WPjOZBnHxuo20fRq9FpzbwSLqn45vU_Fg-lXE7VP81Uc9XFYXDGA-u9KTpEHaxcXfU3QimlgkP_9gS_AFZ6_D_HC1lcRbjPTj1AQRW5p-zytdJwYE7MS95W0JMa2UJi8rDbYB8kcUZDEa_sqcg=w327-h373-no"
